import "../App.css";
import React from "react";

class MyComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }
  handleGetJson(){
    console.log("inside handleGetJson");
    fetch(`./fr.json`, {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }
  
      })
      .then((response) => response.json())
      .then((messages) => {console.log("messages");});
  }

  componentDidMount() {
    fetch("http://localhost:5000/api/autok")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    const { error, isLoaded, items } = this.state;
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <ul>
          {items.map(item => (
            <li key={item.id}>
              {item.nev} {item.elektromos} {item.ar}
            </li>
          ))}
        </ul>
      );
    }
  }
}
export default MyComponent;
